import React from 'react';
import { useSelector } from 'react-redux';
import { Card } from 'antd';
const UserProfile = () => {
    const {user} = useSelector(state => state.user);
    const userMatch = user.filter((v, index) => index !== 0);
    return (
        <>
        <h1>{user[0]}</h1>
        {userMatch.map(match => {
            <Card key ={match.leagueId}
            cover = {
                <img src={require(`../images/${match.tier}.PNG`)}/>
            }>
                <Card.Meta

                />
            </Card>
        })}
        </>
    );
};

export default UserProfile;
